function statisticsAuctionEnd(data, kam){
    console.log('fire post data auctionEnd: '+kam);
    console.log(data);

    if(data.ext){
        data.ext = null;
        console.log('fire data ext(R2B2)');
        console.log(data);
    }else{
        console.log('fire NO data ext(R2B2)');        
    }

//  var strData = JSON.stringify(data);
    var strData = encodeURIComponent(JSON.stringify(data));    
    console.log('strData: '+strData);

    var hbmasterscript = 'hb-0';
    var selection = top.document.body.getAttribute('data-hbmasterscript') !== null;
    if (selection) {
        hbmasterscript = top.document.body.getAttribute('data-hbmasterscript');    
    }
    console.log('statisticsAuctionEnd hbmasterscript: '+hbmasterscript); 

    var xhr = new XMLHttpRequest();
    xhr.open('GET', 'https://hb.impressionmedia.cz/statistics/'+kam+'.php?configId=1201&statistics=1&hbmasterscript='+hbmasterscript+'&data='+strData);
//  xhr.setRequestHeader('Content-Type', 'application/json');
    xhr.onreadystatechange = function () {
      // In local files, status is 0 upon success in Mozilla Firefox
      if(xhr.readyState === XMLHttpRequest.DONE) {
        var status = xhr.status;
        if (status === 0 || (status >= 200 && status < 400)) {
          // The request has been completed successfully
          console.log('xhr.responseText');          
          console.log(status + ': ' + xhr.responseText);
        } else {
            console.log('error in xhr');
          // Oh no! There has been an error with the request!
        }
      }
    };
    xhr.send();

}

